import React from 'react'
import {
  MapContainer,
  TileLayer
} from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import './App.css';

const center = [33.77718230986754, -84.3988154714034];

export default function App() {
  return (
    <MapContainer center = {center} zoom={10} style={{ width: '100vw', height: '100vh'}}>
    </MapContainer>
  );
}
